import React, { useEffect } from "react";

function Perfil(prop){

    useEffect ( () => {
        document.title = prop.atributo_mio;
    } )

    return(
        <div style={{background : "green"}}>
            <h2>{prop.atributo_mio} y Esoy trabajando con React</h2>
        </div>
    );


}


export default Perfil;
